// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMMIData(char *Buffer)
{
    memcpy(Buffer, &JMMIL0[1], JMMIL0[0] << 2);
    Buffer += (JMMIL0[0] << 2);

    memcpy(Buffer, &JMMIL1[1], JMMIL1[0] << 2);
    Buffer += (JMMIL1[0] << 2);

    memcpy(Buffer, &JMMIL2[1], JMMIL2[0] << 2);
    Buffer += (JMMIL2[0] << 2);

    memcpy(Buffer, &JMMIL3[1], JMMIL3[0] << 2);
    Buffer += (JMMIL3[0] << 2);

    memcpy(Buffer, &JMMIL4[1], JMMIL4[0] << 2);
    Buffer += (JMMIL4[0] << 2);

    memcpy(Buffer, &JMMIL5[1], JMMIL5[0] << 2);
    Buffer += (JMMIL5[0] << 2);

    memcpy(Buffer, &JMMIB[1], JMMIB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMMIName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMMIData(void)
{
    remove(JMMIName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMMIData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMMIName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMMIName)) return "";
    #endif

    if (!(han = fopen(JMMIName, "wb"))) return "";
    if (AutoClean) atexit(KillJMMIData);

    num = fwrite(&JMMIL0[1], 4, JMMIL0[0], han);
    if (num != JMMIL0[0]) {fclose(han); return "";}

    num = fwrite(&JMMIL1[1], 4, JMMIL1[0], han);
    if (num != JMMIL1[0]) {fclose(han); return "";}

    num = fwrite(&JMMIL2[1], 4, JMMIL2[0], han);
    if (num != JMMIL2[0]) {fclose(han); return "";}

    num = fwrite(&JMMIL3[1], 4, JMMIL3[0], han);
    if (num != JMMIL3[0]) {fclose(han); return "";}

    num = fwrite(&JMMIL4[1], 4, JMMIL4[0], han);
    if (num != JMMIL4[0]) {fclose(han); return "";}

    num = fwrite(&JMMIL5[1], 4, JMMIL5[0], han);
    if (num != JMMIL5[0]) {fclose(han); return "";}

    num = fwrite(&JMMIB[1], 1, JMMIB[0], han);
    if (num != JMMIB[0]) {fclose(han); return "";}

    fclose(han);
    return JMMIName;
}

